/****** Object:  StoredProcedure [dbo].[GenerateSalesmanCommissionReport]    Script Date: 18-10-2024 13:13:00 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE   PROCEDURE [dbo].[GenerateSalesmanCommissionReport]
AS
BEGIN
    SET NOCOUNT ON;

    CREATE TABLE #SalesCommission (
        SalesmanName NVARCHAR(100),
        Brand NVARCHAR(50),
        FixedCommission DECIMAL(18, 2),
        PercentageCommission DECIMAL(18, 2),
        Bonus DECIMAL(18, 2),
        TotalEarnings DECIMAL(18, 2)
    );

    INSERT INTO #SalesCommission (SalesmanName, Brand, FixedCommission, PercentageCommission, Bonus, TotalEarnings)
    SELECT
        SalesmanName,
        Brand,
        CASE 
            WHEN Brand = 'Audi' AND ModelPrice > 25000 THEN 800
            WHEN Brand = 'Jaguar' AND ModelPrice > 35000 THEN 750
            WHEN Brand = 'Land Rover' AND ModelPrice > 30000 THEN 850
            WHEN Brand = 'Renault' AND ModelPrice > 20000 THEN 400
            ELSE 0
        END AS FixedCommission,
        -- Calculate percentage commission based on car class
        CASE 
            WHEN Class = 'A-Class' THEN ModelPrice * 0.08
            WHEN Class = 'B-Class' THEN ModelPrice * 0.06
            WHEN Class = 'C-Class' THEN ModelPrice * 0.04
            ELSE 0
        END AS PercentageCommission,
        CASE 
            WHEN LastYearSales > 500000 AND Class = 'A-Class' THEN ModelPrice * 0.02
            ELSE 0
        END AS Bonus,
        (CASE 
            WHEN Brand = 'Audi' AND ModelPrice > 25000 THEN 800
            WHEN Brand = 'Jaguar' AND ModelPrice > 35000 THEN 750
            WHEN Brand = 'Land Rover' AND ModelPrice > 30000 THEN 850
            WHEN Brand = 'Renault' AND ModelPrice > 20000 THEN 400
            ELSE 0
        END) + 
        (CASE 
            WHEN Class = 'A-Class' THEN ModelPrice * 0.08
            WHEN Class = 'B-Class' THEN ModelPrice * 0.06
            WHEN Class = 'C-Class' THEN ModelPrice * 0.04
            ELSE 0
        END) + 
        (CASE 
            WHEN LastYearSales > 500000 AND Class = 'A-Class' THEN ModelPrice * 0.02
            ELSE 0
        END) AS TotalEarnings
    FROM SalesData; 

    SELECT * FROM #SalesCommission;

    DROP TABLE #SalesCommission;
END;
GO
/****** Object:  StoredProcedure [dbo].[sp_CarModelManager]    Script Date: 18-10-2024 13:13:00 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE   PROCEDURE [dbo].[sp_CarModelManager]
    @Action NVARCHAR(10),
    @Brand NVARCHAR(50) = NULL,
    @Class NVARCHAR(50) = NULL,
    @ModelName NVARCHAR(100) = NULL,
    @ModelCode NVARCHAR(10) = NULL,
    @Description NVARCHAR(500) = NULL,
    @Features NVARCHAR(500) = NULL,
    @Price DECIMAL(18, 2) = NULL,
    @ManufactureDate DATETIME = NULL,
    @Active BIT = NULL, 
    @SortOrder INT = NULL,
    @SortBy NVARCHAR(50) = NULL,
    @CarID INT = NULL OUTPUT
AS
BEGIN
    IF @Action = 'CREATE'
    BEGIN
        INSERT INTO Car (Brand, Class, ModelName, ModelCode, Description, Features, Price, ManufactureDate, Active, SortOrder)
        VALUES (@Brand, @Class, @ModelName, @ModelCode, @Description, @Features, @Price, @ManufactureDate, @Active, @SortOrder);

        SET @CarID = SCOPE_IDENTITY();
    END
    ELSE IF @Action = 'UPDATE'
    BEGIN
        UPDATE Car
        SET Brand = @Brand, Class = @Class, ModelName = @ModelName, ModelCode = @ModelCode, 
            Description = @Description, Features = @Features, Price = @Price, 
            ManufactureDate = @ManufactureDate, Active = @Active, SortOrder = @SortOrder
        WHERE CarID = @CarID
    END
    ELSE IF @Action = 'DELETE'
    BEGIN
        DELETE FROM Car WHERE CarID = @CarID
    END
END
GO
/****** Object:  StoredProcedure [dbo].[sp_GetAllRecords]    Script Date: 18-10-2024 13:13:00 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE   PROCEDURE [dbo].[sp_GetAllRecords]
    @Action NVARCHAR(50),
    @SearchTerm NVARCHAR(100) = NULL
AS
BEGIN
    SET NOCOUNT ON;

    IF @Action = 'GETALLRECORDS'
    BEGIN
        SELECT * 
        FROM Car
        WHERE (@SearchTerm IS NULL 
               OR ModelName LIKE '%' + @SearchTerm + '%' 
               OR ModelCode LIKE '%' + @SearchTerm + '%')
        ORDER BY ManufactureDate DESC;
    END
END;
GO
/****** Object:  StoredProcedure [dbo].[sp_UpdateCarImages]    Script Date: 18-10-2024 13:13:00 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [dbo].[sp_UpdateCarImages]
    @CarID INT,
    @ImageData VARBINARY(MAX)
AS
BEGIN
    DELETE FROM CarImages WHERE CarID = @CarID;
    
    INSERT INTO CarImages (CarID, ImageData)
    VALUES (@CarID, @ImageData);
END
GO
